import React from "react";
import { Space, Table, Tag } from 'antd';
import 'antd/dist/antd.css';

function Calendar(props) {


const columns = [
    {
      title: 'Oct.24-28',
      dataIndex: 'absence_date',
      key: 'absence_date',
    },
    {
      title: 'Period 1',
      dataIndex: 'period1',
      key: 'period1',
    },
    {
      title: 'Period 2',
      dataIndex: 'period2',
      key: 'period2',
    },
    {
        title: 'Period 3',
        dataIndex: 'period3',
        key: 'period3',
    },
    {
        title: 'Period 4',
        dataIndex: 'period4',
        key: 'period4',
    },
  ];


  const year = new Date().getFullYear();
  
  return (
    <div>
    <Table dataSource={props.data.names} columns={columns} />
    {console.log(typeof(props.data.names?.absence_date))}
    </div>
    
  );
}

export default Calendar;
